import React, { Component } from "react";
import PropTypes from "prop-types";
import {
  Button,
  Header,
  Icon,
  Menu,
  Segment,
  Container,

  Grid,

} from "semantic-ui-react";
import firebase from "../FirebaseAPI";

export class RevCode extends Component {
  render() {
    return (
      <div>
        <Grid>
        <Grid.Row>
          Nav
        </Grid.Row>
        <Grid.Row>
        <Grid.Column width={4}>
        File
        </Grid.Column>
        <Grid.Column width={6}>
        Speech Section
        </Grid.Column>
        <Grid.Column width={6}>
        Code Section
        </Grid.Column>
        </Grid.Row>

        </Grid>
      </div>
    );
  }
}

export default RevCode;

